    render() {

        const { name, flag, rates } = this.props.rateExchange
        console.log(name)

        return (
        <Fragment>
                <tr><td>{name}<br /><img src={flag} alt={name} height="60" width="100" /></td><td><AreaChart data={[["Blueberry", 44], ["Strawberry", 23]]} />
</td></tr>    
